INSERT INTO `words` (`w_no`, `w_content`, `w_createDate`, `w_checkState`, `c_no`, `g_no`) VALUES
(1, '亲亲，早上好！', '2022-04-09', 1, 7, NULL),
(2, '亲亲，有什么可以帮您？', '2022-04-07', 1, 7, NULL),
(3, '亲，您好!很高兴为您服务，有什么为你可以为您效劳的。', '2022-02-09', 1, 7, NULL),
(4, '亲，咱们家都商品都是专柜正品哦，支持专柜验货的，而且我们都是直接跟厂家拿货的', '2022-03-17', 1, 2, NULL),
(5, '亲，我们已经加入假一赔三服务了，如果是假的，您可以申请三倍的赔偿，这对您来说是有保障的呢！', '2022-04-01', 1, 7, NULL),
(6, '亲，我们的宝贝描述里面有详细的辨别真伪的方法，您稍等，我截图给您哦~', '2022-03-17', 1, 3, NULL),
(7, '亲，我们这个产品累计已经有好几千人购买了，都反馈质量不错呢！', '2021-12-24', 1, 2, NULL),
(8, '亲，我们家产品是正规渠道进货，价格已经比线下店铺低很多啦！今天一个顾客一下子买了5件都是这个价格呢~', '2022-03-25', 1, 4, NULL),
(9, '亲，不好意思哦，我们节假日才有礼品的，到时候我一定第一时间通知给您哦。', '2022-03-17', 1, 3, NULL),
(10, '亲，您真幸运，快递员正在我们这取件呢，您现在拍的话我让他等一下，马上给您安排发货！', '2022-03-17', 1, 4, NULL),
(11, '亲，我们默认是发圆通快递哦，我们跟圆通是长期合作的，他们取件比较准时，如果换申通的话今天不一定能发货呢，因为偶尔一两个件他们取货也不积极哦~', '2022-03-17', 1, 5, NULL),
(12, '亲，我是客服玲玲，很高兴为您服务，您想咨询什么产品呢？', '2021-10-15', 1, 5, NULL),
(13, '亲，预计明后天您的快递可以到，到时候注意签收哦，有任何问题欢迎随时跟我联系！~', '2022-02-18', 1, 3, NULL),
(14, '亲亲~~ 我们的产品价格非常实惠，直接按批发价发售，为的是节省双方购买的时间与口舌，是不支持再议价的哦~', '2022-02-24', 1, 5, NULL),
(15, '亲知道，价格和价值是成比例的，您虽然暂时买的比较贵，但是从长期来说还是很便宜的，优质材料的衣服成本高，但是比较耐穿的哦~', '2022-03-16', 1, 3, NULL),
(16, '亲，您的心情我们可以理解的哦，每个买家都希望用最少的钱淘到最好的产品，这是每一个买家的淘心声。作为厂家，首先产品的品质您可以放心，其次售前售后服务一定会让您满意，您购买产品时候不能仅看价格要看其综合的价值哦~', '2022-04-06', 1, 6, NULL),
(17, '您好，亲，我们的产品都是百分百实物拍摄的,但是由于光线及显示器的原因,可能会跟实物稍有差别,但是请您放心,我们已尽量把色差降到最低,也请您谅解。', '2022-02-17', 1, 6, NULL),
(18, '温馨提示：亲收到的包裹时一定要核实是否有破损哦,确保没有问题再签收哦,如有问题第一时间联系我们哦 ~近期网络诈骗猖獗,如接到陌生电话和短信请不用相信,有问题及时联系我们在线客服哦', '2021-12-15', 1, 6, NULL),
(19, '亲~ 由于咨询人员较多，非常抱歉不能及时回复您的信息，您可以在小店先慢慢挑选，马上回复的哦~', '2022-04-23', 1, 6, NULL),
(20, '百分百桑蚕丝填充的哦，收到货可以抽蚕丝出来检测的哈，百分百桑蚕丝，亲放心哦', '2022-04-06', 1, 7, 13),
