(22, '精致的人生是对一切尽善尽美的追求，宠爱自己，宠爱家人，优选七孔春秋被', '2022-03-08', 1, 7, 13),
(23, '感谢您选择七孔春秋被，相遇是很奇妙的事，偶然的相遇，可能突然遇见惊喜的事情，期待与您的再次相会', '2022-05-04', 1, 7, 13),
(24, '您的满意就是我们最大的追求，感谢您给我们好评', '2022-02-09', 1, 7, 13),
(25, '亲爱的顾客，能让您满意就是我们最大的荣幸，我们的乳胶枕都是泰国原装进口的天然乳胶枕，保证用的舒适。', '2022-03-03', 1, 7, 14),
(26, '亲爱的顾客，我们的产品矜持泰国原装进口，采用人体R2曲线设计，柔软细腻', '2022-01-22', 1, 7, 14),
